import React from 'react'

const ContadorCarrito = (props) => {
    console.log(props)
    return (
        <>
        <h2 id="numCarrito">{props.numCarrito}</h2>
        
        </>
    );
}

function numCarrito () {
    return (
        <>
        <ContadorCarrito numCarrito="1"/>
        </>
    );
}

export default ContadorCarrito
